// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./IERC721.sol";
import "./IERC721Receiver.sol";
import "../../utils/introspection/ERC165.sol";
import "../../utils/Context.sol";
import "../../utils/Address.sol";

/*
       NFT minting  

    mint     
    1. NFT    
    2.  ID . [ NFT  Token]
        >  NFT  1, 2, 3..   
    3.  ID     
    4.        NFT  
    5.   ' '   
        >  ,  , ID etc..

*/

contract ERC721 is Context, ERC165, IERC721 {
    using Address for address;

    // Solidity Mapping : Hash Table  -  
    //  ID  Mapping
    mapping(uint256 => address) private _tokenOwner;
    //    Mapping
    // mapping(address => uint256) private _OwnedTokensCount;
    mapping(address => uint256) private _balances;
    //  ID   Mapping
    mapping(uint256 => address) private _tokenApprovals;
    //   operator   
    mapping(address => mapping(address => bool)) private _operatorApprovals;

    constructor() {
        // ERC165 registerInterface  ..?
    }

    // owner   token  return
    function balanceOf(address owner) public view override returns (uint256) {
        require(owner != address(0), "owner query for non-existent token");

        return _balances[owner];
    }

    // tokenId   token owner return
    function ownerOf(uint256 _tokenId) public view override returns (address) {
        address owner = _tokenOwner[_tokenId];
        require(owner != address(0), "owner query for non-existent token");
        return owner;
    }

    // NFT      NFT mint   
    function _exists(uint256 tokenId) internal view returns (bool) {
        address owner = _tokenOwner[tokenId];
        return owner != address(0);
    }

    // virtual :    [override]   
    function _mint(address to, uint256 tokenId) internal virtual {
        //  0  
        require(to != address(0), "ERC721: minting to the zero address");
        //    
        require(!_exists(tokenId), "ERC721: token already minted");

        // mint   tokenId   
        _tokenOwner[tokenId] = to;
        // minting   +1
        _balances[to] += 1;

        emit Transfer(address(0), to, tokenId);
    }

    function transferFrom(
        address _from,
        address _to,
        uint256 _tokenId
    ) public override {
        require(
            isApprovedOrOwner(msg.sender, _tokenId),
            "sender is not token Owner or Approved"
        );
        _transferFrom(_from, _to, _tokenId);
    }

    function _transferFrom(
        address _from,
        address _to,
        uint256 _tokenId
    ) internal {
        require(
            ownerOf(_tokenId) == _from,
            "Trying to transfer a token the address does not own!"
        );
        require(
            _to != address(0),
            "Error - ERC721 Transfer to the zero address"
        );

        /*  unchecked block : overflow  underflow  solidity  
              '' .
            unchecked block   solidity    
            overflow underflow      block  ' '   .
            , overflow / underflow      loop        .
        */
        unchecked {
            _balances[_from] -= 1;
            _balances[_to] += 1;
        }

        _tokenOwner[_tokenId] = _to;

        emit Transfer(_from, _to, _tokenId);
    }

    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public override {
        // overloading  safeTransferFrom  data  callback   
        safeTransferFrom(from, to, tokenId, "");
    }

    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId,
        bytes memory data
    ) public override {
        require(
            isApprovedOrOwner(msg.sender, tokenId),
            "sender is not token Owner or Approved"
        );
        _safeTransferFrom(from, to, tokenId, data);
    }

    function _safeTransferFrom(
        address from,
        address to,
        uint256 tokenId,
        bytes memory data
    ) internal {
        _transferFrom(from, to, tokenId);
        require(
            _checkOnERC721Received(from, to, tokenId, data),
            "ERC721: transfer to non ERC721Receiver implementer"
        );
    }

    /**
     * @dev Internal function to invoke {IERC721Receiver-onERC721Received} on a target address.
     * The call is not executed if the target address is not a contract.
     *
     * @param from  ID    
     * @param to    
     * @param tokenId uint256   ID
     * @param data bytes     
     * @return bool whether the call correctly returned the expected magic value
     */
    function _checkOnERC721Received(
        address from,
        address to,
        uint256 tokenId,
        bytes memory data
    ) private returns (bool) {
        // isContract() : Address.sol 
        if (to.isContract()) {
            try
                IERC721Receiver(to).onERC721Received(
                    _msgSender(),
                    from,
                    tokenId,
                    data
                )
            returns (bytes4 retval) {
                return retval == IERC721Receiver.onERC721Received.selector;
            } catch (bytes memory reason) {
                if (reason.length == 0) {
                    revert(
                        "ERC721: transfer to non ERC721Receiver implementer"
                    );
                } else {
                    /// @solidity memory-safe-assembly
                    assembly {
                        revert(add(32, reason), mload(reason))
                    }
                }
            }
        } else {
            return true;
        }
    }

    //   tokenId      ..?
    function isApprovedOrOwner(address spender, uint256 tokenId)
        internal
        view
        returns (bool)
    {
        //  tokenId mint tokenId 
        require(_exists(tokenId), "token dose not exist");
        address owner = ownerOf(tokenId);
        return (spender == owner || getApproved(tokenId) == spender);
    }

    /*
        approve : tokenId  /  
        1.   tokenId (owner)  (operator) .
        2.      
        3.       map update
    */
    function approve(address _to, uint256 tokenId) public override {
        address owner = ownerOf(tokenId);
        require(_to != owner, "Error - approval to current owner");
        require(
            msg.sender == owner || isApprovedForAll(owner, _msgSender()),
            "Caller is not token owner or approved for all"
        );

        _tokenApprovals[tokenId] = _to;
        emit Approval(owner, _to, tokenId);
    }

    function getApproved(uint256 tokenId)
        public
        view
        override
        returns (address)
    {
        return _tokenApprovals[tokenId];
    }

    function setApprovalForAll(address operator, bool _approved)
        public
        override
    {
        address owner = _msgSender();
        require(owner != operator, "approve to caller");
        _operatorApprovals[owner][operator] = _approved;

        emit ApprovalForAll(owner, operator, _approved);
    }

    function isApprovedForAll(address owner, address operator)
        public
        view
        override
        returns (bool)
    {
        return _operatorApprovals[owner][operator];
    }

    // override from ERC165
    function supportsInterface(bytes4 interfaceId)
        public
        view
        virtual
        override(ERC165)
        returns (bool)
    {
        return
            interfaceId == type(IERC721).interfaceId ||
            super.supportsInterface(interfaceId);
    }
}

